import './App.css';
import * as ventas from './ventas';
interface IState {
  valores:string|string[],
  seprar_ventas:any;
}
class App extends React.Component<{},IState> {
  constructor(props:any) {
      super(props);


      var seprar_ventas=new RegExp("([a-zA-Z]*)(:)?")//"(\	|\ )*(s|S)\/.(\ )*[0-9]+(\,[0-9]*)*(\.[0-9]*)*)" 

      this.state={
        valores:ventas.texto,
        seprar_ventas:seprar_ventas
      }

  }
  render(){
    console.log(this.state.seprar_ventas)
    return(<div>
      {this.state.valores}

    </div>)
  }
}

